  const navigate = useNavigate();

  useEffect(() => {
    const currentPath = window.location.pathname;
    const isCasualNavbar = currentPath.includes('/casual');
    const isProfessionalNavbar = currentPath.includes('/professional');

    // Use the boolean values to conditionally render or perform other logic
    if (isCasualNavbar) {
      // Handle casual navbar logic
    } else if (isProfessionalNavbar) {
      // Handle professional navbar logic
    }

    // ... other logic based on the current route

  }, []); // Empty dependency array ensures the effect runs only once on mount

  return (
    <div>
      {/* Your portfolio content goes here */}
      <h1>Test Portfolio</h1>
    </div>
  );
};

export default Portfolio;
